Warsaw Community Schools is a nationally and state-recognized public school district in Kosciusko County, Indiana. The district spans over a 25x35 mile range and includes schools within the communities of Warsaw, Winona Lake, Claypool, and Leesburg.
WCS serves 7,000+ students and employs approximately 1,200 staff across these schools.

WCS has several open positions in the following areas:
4 Elementary Education Teachers;
1 Elementary Special Ed;
1 Interventionist Servicing Jefferson and Claypool;
3 EL Positions.

WCS is the place to be!
Please share and help us find the BEST candidates to join the WCS family #wcsmission

https://warsawcom.tedk12.com/hire/index.aspx

