post_text:
Attention ALL WCHS students who did NOT schedule classes for next year.

This message is for all students who did NOT schedule classes for next year with their counselor prior to school becoming virtual.

Any student who did not meet with a counselor for scheduling, please check your email. Please email your cell phone number and let your counselor know if they can call you to make arrangements for scheduling.

Counselors need to know your preference for:

Classes for 2020-2021;

Summer School Classes;

Career Pathway;

Diploma Type.

We look forward to getting you all scheduled for the next school year!

Thank you for your assistance! #wcsmission

